Clean&amp;Coat（クリーン＆コート）<BR>
<BR>
【用途】　あらゆる金属・セラミッック・ガラス・プラスチック等の非吸水面を<BR>
　　　　　ナノフィルムが保護します。水溶性に加えナノ素材は生分解性ですので<BR>
　　　　　エコフレンドリーな商品です。車はもちろん家庭やアウトドア用品での<BR>
　　　　　使用も可能です。<BR>
<BR>
【成分】　ナノフッ素順剛体・イオン水<BR>
<BR>
【ご注意】親水加工済み面には使用しないで下さい<BR>
　　　　　曇り止め加工の鏡親水コート済みの車のボディー親水が<BR>
　　　　　撥水に変わってしまいます<br>







