いろいろ使えるシリコン製クリップ！<br>
ケーブルをまとめたり様々な用途で使用できます！<br>
<br>
両端にマグネットを内蔵しているので簡単にまとめたりはさんだりすることができます。<br><br>
デスク周りや鞄の中などグチャグチャになるケーブルを整頓できます。<br>
<br>
マグネット付きで両端を引っ付けるだけ！<br>
ばらつくケーブルをワンタッチでまとめる！<br>
<br>
クリップの両端にマグネットを内蔵しているので、両端を合わせるだけで<br>
引っ付き簡単に結束することができます。<br>
<br>
アイディア次第で使い方はいろいろ！<br>
いろいろな物を止めたりまとめたりできます！<br>
<br>
ホワイトボードにマーカーを止めたり鍵などを止めたり様々な場面で活躍します。<br>
<br>
入り数：8本(各色1個)<br>
サイズ(約)：2.5×1.5×5cm<br>
重量(約)：4g(1個あたり)<br>
材質：シリコン<br>
製造国：中国<br>
<br>
※マグネット部は取り外し可能になっております。紛失にご注意下さい。<br>
※輸入商品に為、若干作りが荒い場合が御座います。ご了承下さい。<br>
