ケーブルの紛失や絡まり防止！両面テープで簡単に固定可能！<br>
<br>
USBケーブルや充電コードなどの紛失や絡まり防止に便利なケーブルホルダー<br>
セットしたままケーブルを引っ張ることができるので、必要な分だけ引っ張って<br>
使用できます。<br>
<br>
両面テープが付属！机などに簡単に設置できます！<br>
<br>
ケーブルホルダーの裏目に両面テープを貼り付けて、机などに設置できます。<br>
うさぎ型で見た目もかわいいです。<br>
<br>
材質：シリコン<br>
サイズ(約)：直径2.5cm×高さ2.7cm<br>
重量(約)：5g<br>
カラー：ピンク、レッド、グリーン、ブルー<br>
セット内容：4個セット(各色1個)<br>
